(27, 'TAL1T', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=EE3100004466&externalidexchange=EX$$$$XTAL&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 0.726, 0.716, 0.7203, 0.716, 'Paavo N&otilde;gene (Chairman), Kadri Land,&nbsp;Harri Hanschmidt, Lembit Kitter,&nbsp;Piret M&uuml;rk-Dubout', '&nbsp;AS Tallink Grupp is the leading European ferry operator, offering high quality mini-cruise and passenger transport services in the Baltic Sea region as well as a leading provider of ro-ro cargo services on selected routes. The Group provides its services on a total of seven routes between Finland and Sweden, Estonia and Finland, Estonia and Sweden, and Latvia and Sweden under the brand names of &ldquo;Tallink&rdquo; and &ldquo;Silja Line&rdquo; and we are the market leader on all our main routes. The Group has a fleet of 14 vessels &ndash; this includes cruise ferries, high-speed ro-pax ferries and ro-ro cargo vessels. In addition, the Group operates three hotels in Tallinn and one in Riga.', ' Address:&nbsp;Sadama 5/7, 10111 Tallinn, Estonia Telephone: +372 6409 800 Fax: +372 6409 810 E-mail: investor@tallink.com Internet webpage: http://www.tallink.com', 'en'),
(28, 'TEL1L', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LT0000123911&externalidexchange=EX$$$$XLIT&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 2.04, 2.01, 2.0229, 2.01, 'Douglas Lubbe (pirmininkas), Agneta Wallmark, Claes&nbsp;Nycander, Hannu-Matti&nbsp;M&auml;kinen, Tomas Balžekas, Mindaugas Glodas', ' Telia Lietuva, AB yra integruotų technologinių sprendimų bendrovė, siūlantis telekomunikacijų, IT ir TV paslaugas i&scaron; vienų rankų. &bdquo;Telia Lietuva&ldquo; siekia kurti vertę klientams ir suteikti geresnę patirtį žmonėms, verslui ir visuomenei. Bendrovė yra &Scaron;vedijoje įsikūrusios &bdquo;Telia Company&ldquo; įmonių grupės dalis. Grupės tikslas &ndash; būti integruotų technologinių sprendimų lydere &Scaron;iaurės ir Baltijos &scaron;alių regione. &bdquo;Telia Company&ldquo; valdo 88 proc. &bdquo;Telia Lietuva&ldquo; akcijų. &bdquo;Telia Company&ldquo; akcijos yra įtrauktos į &bdquo;Nasdaq Stockholm&ldquo; ir &bdquo;Nasdaq Helsinki&ldquo; vertybinių popierių biržos sąra&scaron;us.', ' Adresas: Saltoni&scaron;kių g. 7A, LT-03501, Vilnius, Lietuva Telefonas: (8 5) 262 15 11 &nbsp; Faksas: (8 5) 2126 665 Elektroninis pa&scaron;tas:&nbsp;info@telia.lt Tinklapio adresas:&nbsp;http://www.telia.lt Kontaktinis asmuo: Darius Džiaugys (Ry&scaron;ių su investuotojais vadovas), (8 5) 2367878,&nbsp;darius.dziaugys@telia.lt', 'lt'),
(29, 'TKM1T', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=EE0000001105&externalidexchange=EX$$$$XTAL&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 9.46, 9.42, 9.4423, 9.44, ' Raul Puusepp', 'Tallinna Kaubamaja Group is a renowned trade group in Estonia. Its history dates back to 1960, when Tallinna Kaubamaja was opened. Over several decades, the two department stores in Tallinn and Tartu have grown to become the largest retail group in Estonia. Kaubamaja has retained its image as a beloved, valued and trendy shopping place thanks to its dignified history and the skill to change over time. The largest company of Tallinna Kaubamaja Group is Selver, a chain of super- and hypermarkets that has more than 50 shops across Estonia. With more than 40 million purchases per year, Selver places third in its market segment. In addition to Kaubamaja and Selver, the group includes reputable brands such as Selveri K&ouml;&ouml;k, Tartu Kaubamaja shopping centre, Viimsi Keskus, Viking Motors, KIA, ABC King, SHU, I.L.U., etc. The group also deals in reselling several well-known cars in Estonia, such as KIA, Opel, Peugeot and Cadillac. Their car retail has also expanded to Latvia and Lithuania, where Peugeots are sold in addition to KIAs. Next to retail trade, the group also includes Viking Security, a company providing security services, and Kulinaaria O&Uuml;, the largest company producing ready-to-eat meals in the Baltic region. Partnerkaart, the loyalty programme of the group with more than 650,000 loyal members, has the longest history and the largest number of clients in Estonia. The group has more than 4,000 employees.', 'Address:&nbsp;Kaubamaja 1, 10143 Tallinn, Estonia Telephone: +372 667 3200Fax: +372 667 3205E&ndash;mail: tkmgroup@kaubamaja.eeInternet webpage: http://www.tkmgroup.eeContact person:', 'en'),
(30, 'TSM1T', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=EE3100021635&externalidexchange=EX$$$$XTAL&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 1.83, 1.815, 1.8223, 1.82, 'Valdo Kalm (Chairman), Marko Raid, Margus Vihman', '&nbsp;Tallinna Sadam is one of the largest cargo- and passenger port complexes in the Baltic Sea region, which services over 10 million passengers and 20 million tons of cargo per year. In addition to passenger and freight services, Tallinna Sadam group also operates in shipping business&nbsp;via&nbsp;its subsidiaries &ndash; O&Uuml; TS Laevad provides ferry services between the Estonian mainland and the largest islands, and O&Uuml; TS Shipping charters its multifunctional vessel &ldquo;Botnica&rdquo; for icebreaking and construction services in Estonia and&nbsp;off-shore&nbsp;projects abroad. Tallinna Sadam group is also a shareholder of a joint venture AS Green Marine, which provides waste management services.', ' Address:&nbsp;Sadama 25, 15051 Tallinn, Estonia Telephone: +372 6318 555 E-mail. m.zirel@ts.ee Internet webpage: http://ts.ee/ Contact person: Marju Zirel (Head of Investor Relations)', 'en'),
(31, 'TVEAT', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=EE3100026436&externalidexchange=EX$$$$XTAL&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 13.95, 13.85, 13.9204, 13.95, 'Karl Heino Brookes&nbsp;(Chairman), Aleksandr Timofejev, Kristi Ojak&auml;&auml;r', 'Tallinna Vesi is the largest water utility in Estonia, providing drinking water and wastewater disposal services to over 460,000 people in Tallinn and in several of the neighboring municipalities. The Company operates a 2,000 km2 catchment area to collect raw water, and owns and operates the full range of assets required to treat and supply water and collect and dispose of wastewater and stormwater. The Company is certified to IS0 9001, ISO 14001, ISO 17025, OHSAS 18001&nbsp;and is EMAS accredited. Tallinna Vesi is a classic example of a company transforming itself from a 100% municipally owned water company, through a privatisation in 2001, to a listing on the Tallinn Stock Exchange in June 2005. Currently, 35.3% of the Company is owned by UU Tallinn B.V., 34.7% by the City of Tallinn and 30% of shares are freely floated.The Company is providing high quality service to its customers with a low operating risk. Tallinna Vesi&rsquo;s services comply with all applicable requirements and the Company has an exclusive right to operate as a water and wastewater undertaking in the area until 2025. The Company owns all its assets and is not operating based on a concession contract. The Company has years of comprehensive experience in the field and is therefore able to extend its service area if needed.&nbsp;', 'Address:&nbsp;&Auml;dala 10, 10614 Tallinn, Estonia Telephone: +372 62 62 200Fax: +372 62 62 300 Internet webpage: http://www.tallinnavesi.ee', 'en'),
(32, 'VLP1L', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LT0000127508&externalidexchange=EX$$$$XLIT&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 2.56, 2.48, 2.5183, 2.48, 'Gintaras Berta&scaron;ius (Pirmininkas), Sigitas Trijonis, Rimantas Jancevičius, Vilija Mila&scaron;evičiutė, Linas Strėlis, Andrej Cyba', '', 'Adresas: Vilky&scaron;kiai, LT - 99254 Pagėgių sav., Lietuva Telefonas: (8 441) 553 30 Faksas: (8 441) 552 42 Elektroninis pa&scaron;tas: info@vilvi.euTinklalapio&nbsp;adresas: www.vilkyskiu.ltKontaktinis asmuo: Vilija Mila&scaron;evičiutė (Finansų direktorė), (8 441) 55 102, vilija.milaseviciute@vilvi.eu', 'lt'),
(33, 'AMG1L', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LT0000128696&externalidexchange=EX$$$$XLIT&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 1.01, 0.99, 0.9996, 0.99, 'Algirdas Juozaponis (pirmininkas), Nemunas Biknius, Nerijus Datkūnas,&nbsp;Sigitas Žutautas', 'AB &bdquo;Amber Grid&ldquo; yra Lietuvos gamtinių dujų perdavimo sistemos operatorius, atsakingas už gamtinių dujų perdavimą (transportavimą auk&scaron;to slėgio vamzdynais) sistemos naudotojams, gamtinių dujų infrastruktūros eksploatavimą, priežiūrą ir plėtojimą. AB &bdquo;Amber Grid&ldquo; &scaron;ią veiklą vykdo nuo 2013 m. rugpjūčio 1 d., kai įsigaliojo bendrovei Valstybinės kainų ir energetikos kontrolės komisijos i&scaron;duota laikina gamtinių dujų perdavimo licencija.', 'Adresas:&nbsp;Savanorių pr. 28, LT-03116 Vilnius, Lietuva Telefonas: (8 5) 236 0855 Faksas: (8 5) 236 0850 Elektroninis pa&scaron;tas: info@ambergrid.lt Tinklapio adresas: www.ambergrid.lt Kontaktiniai asmenys: Lina Rudzianskienė (Strateginio planavimo ir i&scaron;orinių ry&scaron;ių skyriaus vadybininkė), (8 5) 232 7748, l.rudzianskiene@ambergrid.lt&nbsp;', 'lt'),
(34, 'BAL1R', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LV0000100808&externalidexchange=EX$$$$XRIS&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 9.05, 8.95, 9.0069, 8.95, '&nbsp; Intars Geidāns (chairman), Guntars Betlers', '', '&nbsp;', 'en'),
(35, 'DPK1R', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LV0000100212&externalidexchange=EX$$$$XRIS&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 0.154, 0.154, 0.154, 0.154, ' Rolands Zarāns (Chairman), Jevgēnijs Kor&scaron;enkovs.', 'The factory was founded in 1949. As the result of privatization, in year 1995 the Joint Stock Company Daugavpils pievadkezu rupnica was established, its statutory capital is 10 360 000 EUR and the nominal value of 1 share is 1.4 EUR. Our main products which are the bush-roller driving chains for bicycles, motorcycles, for the gas-distributive mechanisms\' drives of automobiles, agricultural machinery and different types of drives in industrial equipment, are exported to EU countries, CIS, the same as to the countries of Asia and America. The number of these importers is over 30 countries. There are perfect possibilities for designing and manufacturing of number of machine-building products. The enterprise structure includes also: the machining-tools\' production department fitted with both general-purpose and special-purpose equipment; the laboratories supplied with all necessary metrological equipment and instruments; the group of objects that provides the necessary ecological demands&rsquo; observance; bounded warehouse.', ' Address: 17&nbsp;Vi&scaron;ķu&nbsp;str., Daugavpils, LV-5410, Latvia&nbsp;Phone: + 371 65402333 Internet: www.dpr.lv &nbsp;E-mail: dpr@dpr.lv', 'en'),
