(39, 'KA11R', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LV0000100402&externalidexchange=EX$$$$XRIS&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 0.67, 0.67, 0.67, 0.67, '&nbsp; Pēteris Frīdenbergs&nbsp;(Chairman),&nbsp;Aiga Ozola, Voldemārs Magone', 'Since 1960 JSC &bdquo;Kurzemes Atslega 1&rdquo; specializes in production of door locks and metalware. Then the company has named as metal hardware and door lock factory &bdquo;Aizpute&rdquo;. In 1965 it was renamed as metal hardware factory &bdquo;Kurzeme&rdquo;.In 1996 the company became joint stock company &bdquo;Kurzemes Atslega 1&rdquo;.The basic production of the enterprise is production of door locks and different bindings, furniture locks, door and window hinges and fittings, building fasteners, forged pieces for gates, fences, balconies and staircases and other fabricated metal products.Besides the company offers a wide range of services: metal and plastic casting, surface treatment such as galvanizing, powder painting, nickel and chrome plating, metal stamping and forming, as well as production of press tools and moulds.JSC &bdquo;Kurzemes Atslega 1&rdquo; continuously expands its production, following the requirements of customers.The majority of employees are working at the enterprise for years and have wide practical experience and excellent skills. This makes a good basement for high quality of products. The company is the leading manufacturer of the above mentioned products in Latvia and Baltic states. The production is being delivered both to the local marked and abroad.', ' &nbsp;Address: Kalvenes 27, Aizpute, LV 3456, Latvija Phone: &nbsp;(+371 ) 63448075 E-mail: info@ka1.lvInternet web page: www.ka1.lv', 'en'),
(40, 'KNR1L', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LT0000123010&externalidexchange=EX$$$$XLIT&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 0.83, 0.8, 0.8177, 0.81, 'Nerijus Mordas, Algimantas Stasys Anužis,&nbsp;Paulius Keras, Karolis &Scaron;iugžda, Karolis Dekeris.', ' AB &ldquo;Kauno energija&rdquo; - tai &scaron;ilumos perdavimo ir paskirstymo, &scaron;ilumos ir elektros gamybos&nbsp;įmonė&nbsp;Kauno bei Jurbarko mieste bei Kauno rajone.&nbsp;Bendrovė savo veiklą vykdo pagal turimas atitinkamas veiklos licencijas.&nbsp;Įmonė buvo įkurta 1963 metais kaip Kauno &scaron;iluminių tinklų įmonė.&nbsp;2018 m.&nbsp;gruodžio 31 d. AB &ldquo;Kauno energija&rdquo; dirbo&nbsp;427 darbuotojai.', '&nbsp;Adresas: Raudondvario pl. 84, LT-47179 Kaunas, Lietuva Telefonas: (8 37)&nbsp;305650 Faksas: (8 37)&nbsp;305622 Elektroninis pa&scaron;tas: info@kaunoenergija.lt Tinklapio adresas: www.kaunoenergija.lt Kontaktinis asmuo:&nbsp;Ūdrys&nbsp;Staselka, atstovas ry&scaron;iams su visuomene, (8 37) 305885, u.staselka@kaunoenergija.lt', 'lt'),
(41, 'LGD1L', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LT0000128415&externalidexchange=EX$$$$XLIT&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 0.685, 0.595, 0.6171, 0.595, 'Algirdas Juozaponis (pirmininkas), Rimvydas &Scaron;tilinis, Jūratė Marcinkonienė, Domas Sidaravičius, Artūras Vilimas&nbsp; ', '&nbsp;&bdquo;Litgrid&ldquo; &ndash; Lietuvos elektros perdavimo sistemos operatorius, valdantis &scaron;alies elektros energijos srautus ir palaikantis stabilų elektros energetikos sistemos darbą. &bdquo;Litgrid&ldquo; atsako už &scaron;alies elektros sistemos vientisumą ir suderinamumą: užtikrina patikimą, efektyvų, kokybi&scaron;ką, skaidrų ir saugų elektros energijos perdavimą, &scaron;alies elektros gamybos ir vartojimo balansą bei prekybą elektros energija, pagaminta atsinaujinančius energijos &scaron;altinius naudojančių bei vie&scaron;uosius interesus atitinkančias paslaugas (VIAP) teikiančių elektros gamintojų.', ' Adresas:&nbsp;Vir&scaron;uli&scaron;kių skg. 99B LT-05131, Vilnius, Lietuva&nbsp; Telefonas:&nbsp;+370&nbsp;707 02171Elektroninis pa&scaron;tas:&nbsp;info@litgrid.euTinklapio adresas:&nbsp;http://www.litgrid.euKontaktiniai asmenys:&nbsp;Jurga Eivaitė (Komunikacijos vadovė)', 'lt'),
