(44, 'RAR1R', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LV0000100881&externalidexchange=EX$$$$XRIS&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 0.286, 0.25, 0.2521, 0.26, 'Ēriks Kaža (Chairman), Gunārs Lubis&nbsp;', 'The company was founded in 1946 as a manufacturer of components &ndash; electric equipment for automobiles and tractors - for the enterprises of automotive industry. In 1998 the company was privatised and transformed into a public joint stock company.The company offers the following products:1.&nbsp;Control and measuring devices for motorcars and tractors: &bull;&nbsp;instrument panels and assemblies as well as separately speedometers, tachometers, manometers, voltmeters, indicators of pressure, indicators of fuel level, indicators of coolant temperature,&bull;&nbsp;fuel level gauges, &bull;&nbsp;pressure operated alarm switches, &bull;&nbsp;switch devices for motor vehicle board systems to control the level of oil, coolant and washing fluid.2.&nbsp;Automotive accessories: &bull;&nbsp;windshield wipers as well as their arms and blades, &bull;&nbsp;headlamp wipers&rsquo; arms and blades, &bull;&nbsp;steering column switches.The following technological processes are used in the manufacturing process:&nbsp; metal machining and punching, pressure casting of zinc alloys as well as plastics, galvanic and paint coating and assembling of finished products. The company performs strict control over quality of all technological processes as well as testing of manufactured devices so that they correspond to the respective requirements of international standards and those of the respective customer. The company has introduced quality management system corresponding to ISO 9001:2000.The most part of the manufactured goods (90%) are exported, mainly to Russia, Byelorussia and Ukraine.The strategy of the enterprise is to establish long-term business relations with leading automobile and tractor manufacturing companies in Russia and other countries offering them high-quality products based on advanced technology.', 'Address: Klijānu iela 18, Rīga, LV 1013, LatvijaPhone: + 371 67371459Home page: www.rarlv.carrd.coE-mail: rimowood2@inbox.lv', 'en');

