INSERT INTO `papildomainformacija` (`Id`, `AkcijosKodas`, `AtaskaitosURL`, `DidKaina`, `MinKaina`, `VidKaina`, `AtidarymoKaina`, `Vadyba`, `Apie`, `Kontaktai`, `Kalba`) VALUES
(1, 'APG1L', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LT0000102337&externalidexchange=EX$$$$XLIT&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 1.73, 1.705, 1.7164, 1.73, 'Darius Juozas Mockus (Pirmininkas), Rimantas Perveneckas, Ilona &Scaron;imkūnienė, Ramūnas Gaidamavičius, Vidas Lazickas, Marijus Strončikas', ' &bdquo;Aprangos&ldquo; grupė &ndash; mažmeninės prekybos drabužiais lyderė Baltijos &scaron;alyse.  &bdquo;Aprangos&ldquo; grupė plėtoja nuosavus prekybos tinklus: Apranga, Aprangos galerija, City, Mados Linija. Grupė taip pat pagal fran&scaron;izės kontraktus valdo Zara, Burberry, Hugo Boss, Emporio Armani, Ermenegildo Zegna, Max Mara, Mango, Massimo Dutti, Bershka, Pull and Bear, Stradivarius, Zara Home, s.Oliver, Promod, Orsay parduotuves Lietuvoje, Latvijoje ir Estijoje. 2017 metų pabaigoje bendras &bdquo;Aprangos&rdquo; grupės valdomas prekybos plotas sudarė daugiau nei 84 tūkst. kv.m.  Įmonės istorija prasidėjo 1945 metais, kuomet buvo įkurta drabužių ir avalynės didmeninė bazė. 1993 metais įkurtas mažmeninės prekybos tinklas. &bdquo;Aprangos&rdquo; grupė savo veiklą Latvijoje pradėjo 2003 m., o Estijoje &ndash; 2004 metais. 2004 metais Grupė tapo Inditex partneriu Baltijos &scaron;alyse. &Scaron;iuo metu &bdquo;Aprangos&rdquo; grupę sudaro pagrindinė įmonė APB &bdquo;Apranga&rdquo; ir 23 dukterinės bendrovės.  2018 metais &bdquo;Aprangos&ldquo; grupėje dirbo per 2100 žmonių.&nbsp;&nbsp;', 'Adresas: Ukmergės g. 362, LT-12106 Vilnius, Lietuva Telefonas: (8 5) 2390 808 Faksas: (8 5) 2390 800 Elektroninis pa&scaron;tas: info@apranga.lt Tinklapio adresas: www.aprangagroup.comKontaktinis asmuo:&nbsp;Saulius Bačauskas&nbsp;(\"Aprangos\" grupės finansų ir ekonomikos direktorius), (8 5) 2390 843', 'lt'),
(2, 'ARC1T', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=EE3100034653&externalidexchange=EX$$$$XTAL&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 1.32, 1.3, 1.3012, 1.32, 'Miko-Ove Niinem&auml;e', 'Arco Vara is a real estate development company, which also sells its brand name for real estate agencies in Estonia, Latvia and Bulgaria.Arco Vara is established in 1992 and we are primarily committed to offering our clients high quality and complex living environment in Estonia and Bulgaria.&nbsp;', 'Address: Maakri 19/1, Tallinn, 10145,&nbsp;EstoniaTelephone: +372 6144 630E-mail: info@arcovara.comWebpage: www.arcovara.com', 'en'),
(3, 'AUG1L', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LT0000127466&externalidexchange=EX$$$$XLIT&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 0.444, 0.44, 0.4419, 0.44, 'Dalius Misiūnas (pirmininkas), Murray Steele,&nbsp;Tomas Kučinskas, Tomas Krakauskas,&nbsp;Andrej Cyba', '', 'Adresas: Konstitucijos pr. 21c, LT-08130, Vilnius,&nbsp;Lietuva Telefonas: (8 5) 233 53 40 Faksas: (8 5) 233 53 45 Elektroninis pa&scaron;tas:&nbsp;info@auga.ltTinklapio adresas: http://www.auga.lt Kontaktinis asmuo:&nbsp;Mindaugas Ambrasas, Finansų departamento direktorius, m.ambrasas@auga.lt&nbsp;', 'lt'),
(4, 'BLT1T', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=EE3100145616&externalidexchange=EX$$$$XTAL&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 0.397, 0.38, 0.3895, 0.39, 'Flavio Perini (Chairman), Triinu Tarkin', ' The Baltika Group is a rapidly growing fashion retailer in the Baltic States, Central and Eastern Europe.&nbsp; The Group operates four retail concepts: Monton, Mosaic, Baltman and Ivo Nikkolo. Baltika employs a vertically integrated business model which means that the Group controls all stages of the fashion process: design, manufacturing, supply chain management, distribution/logistics and retail sales. Such a model enables Baltika to offer new fashion goods every week and assures high availability of basics.', ' Address: Valukoja 10, 11415 Tallinn, Estonia Telephone: +372 630 2801Fax: +372 630 2814E&ndash;mail: baltika@baltikagroup.com &nbsp; Internet webpage: http://www.baltikagroup.com', 'en'),
(5, 'CPA1T', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=EE3100007857&externalidexchange=EX$$$$XTAL&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 1.25, 1.23, 1.2423, 1.25, ' Margus Rink (Chairman), Heikko M&auml;e, Kerli L&otilde;hmus, Rasmus Heinla, Arko Kurtmann', 'Estonian-owned Coop Pank is one of the five universal banks operating in Estonia. It uses the synergy generated between retail trade and banking and brings everyday banking services closer to where people live. The bank&rsquo;s mission is to boost Estonian companies and help people make their dreams come true in every corner of Estonia &ndash; in the countryside as well as in the cities. Coop Pank has 15 branches and 28 banking points throughout Estonia. Coop Pank has been implementing a growth strategy since it entered the market in 2017 and increased its operating volumes by ca 30% per year. Coop Pank employs over 230 people and has over 58,300 everyday banking clients. The strategic shareholder of the bank is the locally-owned retail chain Coop Estonia, which has a sales network of 330 stores and approximately 600,000 loyal customers.', 'Address: Narva mnt 4, 15014 Tallinn, Republic of EstoniaTelephone: +372&nbsp;669 0966Fax: + 372 661 6037Website: www.cooppank.ee', 'en'),
(6, 'EEG1T', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=EE3100016965&externalidexchange=EX$$$$XTAL&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 0.805, 0.77, 0.7849, 0.8, 'Mari-Liis R&uuml;&uuml;tsalu&nbsp;(Chairman), Signe Kukin, Kaspar Hanni', 'AS Ekspress Grupp&nbsp;is the leading media group in the Baltic States whose key activities include web media content production, publishing of newspapers and magazines and provision of printing services in Estonia, Latvia and Lithuania. The Group also manages the electronic ticket sales platform and ticket sales sites in Latvia. Group has a strong internal capability for provision of digital content and advertising solutions, group also arranges impressive and memorable entertainment events.&nbsp;Ekspress Grupp that launched its operations in 1989 employs almost 1700 people, owns leading web media portals in the Baltic States and publishes the most popular daily and weekly newspapers as well as the majority of the most popular magazines in Estonia.', ' Address: Parda 6, 10151 Tallinn, Republic of Estonia Phone: +372 669 8381E-mail: egrupp@egrupp.ee Homepage: http://www.egrupp.ee', 'en'),
(7, 'EFT1T', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=EE3100127242&externalidexchange=EX$$$$XTAL&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 19.4, 19.3, 19.3564, 19.4, 'Viljar Arakas, T&otilde;nu Uustalu', 'EfTEN Real Estate Fund III AS is a public closed alternative investment fund&nbsp;established in 2015. The fund invests in cash flow generating commercial properties in Baltic states. Its&nbsp;investment strategy is value added and opportunistic. Fund is mainly targeted to retail investors.', 'Address: A. Lauteri 5, Tallinn, 10114, EstoniaTelephone: +372 655 9515E-mail: info@eften.eeInternet webpage: www.eref.ee/en/Contact person: Viljar ArakasE-mail:&nbsp;Viljar.Arakas@eften.ee', 'en'),
(8, 'GRG1L', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LT0000102030&externalidexchange=EX$$$$XLIT&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 1.48, 1.39, 1.4248, 1.39, 'Gintautas Pangonis (Pirmininkas), Algimantas Variakojis, Vigmantas Kažukauskas, Tomas Jozonis, Saulius MartinkevičiusStebėtojų tarybaNorimantas Stankevičius (Pirmininkas), Vilius O&scaron;keliūnas, Romualdas Degutis, Normantas Paliokas, Daiva Duksienė', ' Grigi&scaron;kių popieriaus fabrikas įkurtas 1823 metais. Daugiau nei pusantro &scaron;imto metų darbo patirtis popieriaus ir medienos pramonėje, &scaron;iuolaikinės gamybos technologijos, moderni įranga bei kvalifikuotas ir kompetentingas personalas sudaro palankias sąlygas gaminti itin auk&scaron;tos kokybės ir klientų poreikius atitinkančius gaminius. AB \"Grigeo\" gamina tualetinį popierių, popierinius rank&scaron;luosčius ir nosinaites.&nbsp;Daugiau nei&nbsp;pusė gaminamos produkcijos yra eksportuojama į Latviją, Daniją, Estiją, Suomiją, Nyderlandus,&nbsp;Lenkiją, Ukrainą, &Scaron;vediją, Vokietiją bei kitas &scaron;alis. AB \"Grigeo\"&nbsp;- pirmoji popieriaus įmonė Lietuvoje, gavusi kokybės vadybos sistemos LST EN ISO 9001 sertifikatą.Bendrovėje dirba apie 300 profesionalių ir patyrusių darbuotojų. ', 'Adresas: Vilniaus g.10, Grigi&scaron;kės, LT-27101 Vilniaus m. sav., Lietuva Telefonas: (8 5) 2435801, (8 5) 2435820 Faksas: (8 5) 2435802 Elektroninis pa&scaron;tas: info@grigeo.ltTinklapio adresas: www.grigeo.ltKontaktinis asmuo:&nbsp;Martynas Nenėnas, Finansų direktorius, Tel.: +370 695 29530, martynas.nenenas@grigeo.lt', 'lt'),
(9, 'HAE1T', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=EE3100004250&externalidexchange=EX$$$$XTAL&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 5.5, 5.46, 5.4894, 5.5, 'Tiit Atso (Chairman), Aron Kuhi-Thalfeldt', 'After launching its activities in 1968, Harju Elekter Group has developed into a leading producer of MV/LV electrical and engineering devices in the Baltic countries and a well-known and respected manufacturer in Scandinavia. Harju Elekter&rsquo;s main field of business is the development, manufacturing and sale of equipment necessary for the distribution and transmission of electric energy. The main business is supported by a sheet metal plant in Estonia and the development and leasing of industrial real estate. Harju Elekter Group&rsquo;s subsidiaries in Estonia, Finland, Sweden and Lithuania employ more than 500 specialists, and the annual sales revenue of the Group exceeds 60 million euros. Shares of Harju Elekter are listed on Nasdaq Tallinn.', ' Address: Paldiski Rd. 31, 76606 Keila, Estonia Telephone: +372 67 47 400 Fax: +372 67 47 401 E&ndash;mail: he@he.ee Internet webpage: http://www.harjuelekter.ee Contact person: Moonika Vetevool (Corporate communication and investor relations manager)', 'en'),
(10, 'HMX1R', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LV0000101590&externalidexchange=EX$$$$XRIS&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 9.2, 9.15, 9.1528, 9.15, '&nbsp;  Ilmārs Osmanis (Chairman), Māris Macijevskis, Jānis Sams  ', '&nbsp; Joint-stock company &ldquo;HansaMatrix&rdquo; is a fast-growing, high-technology company offering product design, industrialization and complete manufacturing services in data networking, Internet of Things, industrial segments and other high added value business segments. In addition to complete manufacturing services of OEM products, our company offers an ODM business model to both start-up and established companies that seek product development partnerships. The entirety of engineering and manufacturing processes of joint-stock company &ldquo;HansaMatrix&rdquo; take place at the manufacturing plants and engineering sites in Ogre, Ventspils, Mārupe and Riga.   Contacts:', '&nbsp; Legal address:&nbsp;Akmeņu street 72, Ogre, Ogres novads, LV-5001, Latvia Phone: +371 67800002Web page: www.hansamatrix.com &nbsp; E-mail: invest@hansamatrix.com &nbsp;  Contactperson: Ilmārs Osmanis Phone: + 371 67800002E-mail:&nbsp;ilmars.osmanis@hansamatrix.com', 'en'),
(11, 'IGN1L', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LT0000115768&externalidexchange=EX$$$$XLIT&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 21.6, 21.05, 21.2095, 21.1, 'Darius Maik&scaron;tėnas (pirmininkas),', '&nbsp;', 'Adresas: Žvejų g. 14, LT-09310 Vilnius, LietuvaTelefonas: (8 5) 278 2998', 'lt'),
(12, 'KNF1L', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LT0000111650&externalidexchange=EX$$$$XLIT&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 0.32, 0.318, 0.3194, 0.319, 'Giedrius Dusevičius (pirmininkas), Mantas Bartu&scaron;ka, Dainius Bražiūnas,&nbsp;Bjarke P&aring;lsson, Ian Jonathan Bradshaw', '&nbsp;AB &bdquo;Klaipėdos nafta&ldquo; veiklą sudaro pagrindinės trys kryptys:', 'Adresas: Burių g. 19, 91003 Klaipėda, Lietuva Telefonas: (8 46) 391772 Faksas: (8 46) 311399 Elektroninis pa&scaron;tas: info@kn.lt&nbsp;Tinklapio adresas:&nbsp;www.kn.lt&nbsp;Kontaktinis asmuo:&nbsp;Jonas Lenk&scaron;as&nbsp;(Finansų&nbsp;direktorius), 8&nbsp;694 80594, j.lenksas@kn.lt', 'lt'),
(13, 'LHV1T', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=EE3100073644&externalidexchange=EX$$$$XTAL&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 25, 23.3, 24.0024, 24.4, 'Madis Toomsalu', 'LHV Group is the largest domestic financial group and capital provider in Estonia that is currently holding close to 5 billion euros of Estonian assets. LHV Group\'s key subsidiaries are AS LHV Pank and AS LHV Varahaldus. LHV has representative offices in Tallinn and Tartu, LHV Bank has a branch in the United Kingdom. LHV employs over 470 people and has more than 9700 investors. LHV Bank services are used by more than 221,000 customers. Pension funds managed by LHV have close to 178,000 active customers.', 'Address: Tartu mnt 2, Tallinn, 10145,&nbsp;EstoniaTelephone: +372 6800 400Fax: +372 6800 402E-mail: lhv@lhv.eeInternet webpage: www.lhv.eeContact person: ', 'en'),
(14, 'LNA1L', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LT0000128092&externalidexchange=EX$$$$XLIT&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 0.725, 0.705, 0.7177, 0.71, 'Darius Zubas (Pirmininkas), Arūnas Zubas, Dainius Pilkauskas, Andrius Pranckevičius, Tomas Tumėnas,&nbsp;Jonas Bak&scaron;ys', '', 'Adresas: Smėlynės g. 2C, Panevėžys LT-35143, Lietuva Telefonas: (8 45) 507 303 Elektroninis pa&scaron;tas: group@linasagro.ltTinklalapio adresas: http://www.linasagrogroup.ltKontaktinis asmuo:&nbsp;Mažvydas &Scaron;ileika&nbsp;(Finansų direktorius), mob. 8 619 19 403, el.p.&nbsp;m.sileika@linasagro.lt', 'lt'),
(15, 'MRK1T', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=EE3100098328&externalidexchange=EX$$$$XTAL&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 10.05, 9.94, 9.9916, 9.98, 'Andres Trink, T&otilde;nu Toomik', '&nbsp;AS Merko Ehitus is the leading group of construction companies in the Baltics, offering comprehensive construction and real estate development solutions in Estonia, Latvia, Lithuania and Norway. We offer a wide range of construction services along with design service (including BIM) in all of the main fields: construction of buildings (hotels, retail and logistics centres, office and manufacturing facilities), civil engineering (viaducts, ports, substations, power plants and external networks, water resources management infrastructure), road construction and concrete works.&nbsp;', ' Address: J&auml;rvevana tee 9G, 11314 Tallinn, Estonia Telephone: +372 6&nbsp;501 250Fax: +372 6&nbsp;501&nbsp;251 E-mail: group@merko.eeInternet webpage:&nbsp;http://group.merko.ee/en/&nbsp;&nbsp;Contact person:&nbsp;Priit Roosim&auml;gi&nbsp;(Head of group finance unit)', 'en'),
(16, 'NCN1T', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=EE3100039496&externalidexchange=EX$$$$XTAL&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 1.1, 1.08, 1.0917, 1.09, 'Gerd M&uuml;ller&nbsp;(chairman), Maret Tambek, Priit Luman', ' Nordecon AS articles of association was signed in the end of 1988 and the beginning of the activities started in February 1989. Nordecon is a group of construction companies whose core business is construction project management and general contracting in the buildings and infrastructures segment. Activities in buildings segment include construction of commercial-, industrial-, public and residential buildings. Infrastructure segment includes road construction and maintenance, specialist (incl. hydraylic) engineering, environmental engineering and construction of water and wastewater networks. The Group includes a company specialized on concrete works. Geographically the Group operates in Estonia, Sweden, Finland and Ukraine. The parent of the Group is Nordecon AS, a company registered and located in Tallinn, Estonia. Currently Nordecon Group employs approximately 700 people. Significant subsidiaries:&nbsp;Eston Ehitus AS (100%), Tariston AS (100%), O&Uuml; Eurocon (100%), Kaurits O&Uuml; (100%), SweNCN AB (100%), Nordecon Betoon O&Uuml; (52%) and Embach Ehitus (51%).', ' Address: Toompuiestee 35, 10133 Tallinn, Estonia Telephone: +372 615 4400 Fax: +372 6 154 401 E-mail: nordecon@nordecon.com&nbsp;&nbsp;Internet webpage: http://www.nordecon.comContact person: Andri H&otilde;bem&auml;gi (Head of Investor Relations)&nbsp;andri.hobemagi@nordecon.com', 'en'),
(17, 'NTU1L', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LT0000131872&externalidexchange=EX$$$$XLIT&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 3.02, 2.98, 2.9919, 3.02, 'Virginijus Lepe&scaron;ka (pirmininkas), Vidas Paliūnas, Ugnius Radvila, Janek Pohla, Andrius Jurkonis.', '&nbsp;', 'Adresas:', 'lt'),
(18, 'OLF1R', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LV0000100501&externalidexchange=EX$$$$XRIS&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 7.26, 7.22, 7.242, 7.26, ' Jeroen Hidde Weites (Chairman), Raimonds Terentjevs, Signe Baldere-Sildedze, Milana Beļeviča,&nbsp;Elena Bushberg, Zane Kotāne', ' Olaine Chemical-Pharmaceutical Plant was established in October 10, 1972 as a state enterprise. At the beginning, the factory manufactured only biologically active substances. Later it also started manufacturing finished pharmaceuticals, and the factory became one of the largest chemical-pharmaceutical enterprises in the Soviet Union producing more than 25 products.&nbsp; JSC Olaine Chemical-Pharmaceutical Plant is the largest chemical - pharmaceutical manufacturer in the Baltic States. The main activities of the company are: - production of high quality biologically-active and other chemical compounds through organic synthesis, both for the existing products and customised orders (contract manufacturing); - production of finished pharmaceuticals from self-synthesised, as well as purchased substances, mostly in the form of tablets and capsules. Presently JSC Olainfarm manufactures 78 finished pharmaceuticals and 35 different active pharmaceutical substances and chemical intermediaries. The main export markets for the company are the CIS states (Russia, the Ukraine, Byelorussia etc.) accounting for more than half of total output. Export of products to the European Union is less than 10%. Russian crisis of 1998 created the need for reorientation of market priorities, as it had a substantially negative effect on the company&rsquo;s performance and its shares&rsquo; prices. In 1998 the company started the actual re-orientation towards the Western markets. At present contracts for manufacturing of chemical intermediates are concluded with several Western companies.', ' Address: 5 Rūpnīcu&nbsp;str., Olaine, Latvia, LV-2114&nbsp;Phone: + 371 67013700 Internet: www.olainfarm.lvE-mail: olainfarm@olainfarm.lv', 'en'),
(19, 'PKG1T', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=EE3100006040&externalidexchange=EX$$$$XTAL&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 0.705, 0.7, 0.7004, 0.705, 'Allan Remmelkoor, Paolo Vittorio Michelozzi, Edoardo Axel Preatoni', 'Pro Kapital Grupp is a leading Estonian real estate development company with a focus on modern large-scale commercial and residential real estate projects in the capitals of Estonia, Latvia and Lithuania. Since its establishment in 1994, Pro Kapital has completed 20 development projects with ca 180,000 square meters of total saleable area. Pro Kapital&rsquo;s projects have been milestones in the Baltic real estate market. Every day, more than 50,000 people wake up, go to work, do their shopping or eat out in the buildings developed by Pro Kapital. The estimated value of the investments in Pro Kapital&rsquo;s current real estate portfolio is 180.0 million euros: 64% residential developments, 24% commercial premises and 12% hotels (Newsec: April, June 2012). The Company will fully comply with the Corporate Governance Recommendations. ', '&nbsp;Address: S&otilde;jakooli 11, 11316, Tallinn, EstoniaAllan Remmelkoor&nbsp;Member of the Management Board of Pro Kapital Grupp Phone: +372&nbsp;6144&nbsp;920 E-mail: prokapital@prokapital.eeWebpage:&nbsp;http://prokapital.com/', 'en'),
(20, 'PRF1T', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=EE3100101031&externalidexchange=EX$$$$XTAL&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 0.374, 0.362, 0.3658, 0.372, 'Indrek Kasela (Member of )', 'AS PRFoods is a company engaged in food processing and sales. It is listed on the main list of Nasdaq Tallinn Stock Exchange since 5 May 2010.', 'Address: P&auml;rnu mnt 141, 11314 Tallinn, Estonia Telephone: +372 452 1470 E-mail: investor@prfoods.eeInternet webpage: http://www.prfoods.eeContact person: Indrek Kasela, CEO, +372&nbsp;452 1470', 'en'),
