(22, 'PZV1L', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LT0000111676&externalidexchange=EX$$$$XLIT&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 1.4, 1.38, 1.38, 1.38, 'Julius Kvaraciejus (Pirmininkas),&nbsp;Vitalis Pa&scaron;kevičius, Voldemaras Klovas, Aleksandr Smagin, Gžegož Rogoža, Regina Kvaraciejienė, Artiom Smagin.', ' Baltijos &scaron;alyse pirmaujanti pieno perdirbimo bendrovė AB &ldquo;Pieno žvaigždės&rdquo; ypatingą dėmesį skiria &scaron;viežių pieno produktų gamybai bei eksportui. Bendrovės strategija - nuolatinis pozicijų stiprinimas pieno perdirbimo srityje, i&scaron;laikant glaudų ry&scaron;į su vartotojais bei numatant paklausos tendencijas. &Scaron;iuolaiki&scaron;ka perdirbimo įranga, griežtai kontroliuojama kokybė (ISO 9001), inovatyvi marketingo strategija bei profesionali vadovų komanda užtikrina efektyvų bei pelningą vystymąsi konkurencinėje aplinkoje.', '&nbsp;Adresas:&nbsp;Perkūnkiemio g.3, LT-12127 Vilnius, Lietuva Telefonas: (8 5) 2461414 Faksas: (8 5) 2461415 Elektroninis pa&scaron;tas: info@pienozvaigzdes.lt Tinklapio adresas: http://www.pienozvaigzdes.lt Kontaktinis asmuo:&nbsp;Audrius Statulevičius&nbsp;(Finansų direktorius), (8 5) 246 1419, a.statulevicius@pienozvaigzdes.lt ', 'lt'),
(23, 'RSU1L', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LT0000100372&externalidexchange=EX$$$$XLIT&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 3.1, 3.1, 3.1, 3.1, 'Antanas Trumpa (pirmininkas), Antanas Kavaliauskas (valdybos pirmininko pavaduotojas),&nbsp;Darius Norkus, Paul M Campbell, Ramūnas Vanagas', ' AB &bdquo;Roki&scaron;kio sūris&ldquo; = Patikimi Pieno Pramonės Profesionalai. Tai Baltijos regione&nbsp;efektyviausia pieno produktų gamybos įmonė bei Pieno pramonės lyderė Lietuvoje ir Baltijos &scaron;alyje pagal perdirbamo pieno kiekį&nbsp;ir fermentinio sūrio gamybą. Jos pardavimai plačiai i&scaron;skaidyti &ndash; tiek eksportas į Rytų bei Vakarų rinkas, tiek pilnas spektras &scaron;viežių pieno produktų, kurie skirti tiek vidaus rinkos, tiek kaimyninių &scaron;alių poreikiams patenkinti. AB &bdquo;Roki&scaron;kio sūris&ldquo; grupės gamyba yra vystoma Roki&scaron;kio (AB &bdquo;Roki&scaron;kio sūris&ldquo;), Utenos (UAB &bdquo;Roki&scaron;kio pienas&ldquo;) ir Ukmergės miestuose (UAB &bdquo;Roki&scaron;kio pienas&ldquo; filialas &bdquo;Ukmergės pieninė&ldquo;). Roki&scaron;kio įmonės specializacija &ndash; fermentinių sūrių, bei pieno cukraus (laktozės) gamyba. Utenos įmonės specializacija &ndash; &scaron;vieži pieno produktų vietinei rinkai, i&scaron;rūgų baltymų koncentrato, pieno miltų ir sviesto gamyba. Ukmergės įmonės specializacija &ndash; var&scaron;kės ir var&scaron;kės produktų gamyba. Daugiau nei 2/3 produkcijos AB &bdquo;Roki&scaron;kio sūris&ldquo; grupė eksportuoja. Didžiąją eksporto dalį sudaro fermentiniai sūriai. Grupė nuo seno orientuojasi į masinę jų gamybą ir yra viena i&scaron; didžiausių bei žinomiausių jų gamintojų Centrinės ir Rytų Europos regione. Roki&scaron;kio sūris pagamina apie 30 tūkst. tonų fermentinių sūrių per metus. Grupėje dirba vir&scaron; 1500 darbuotojų. Didelį dėmesį įmonės skiria produktų saugai ir kokybei, klientų poreikių, aplinkosaugos reikalavimų tenkinimui. AB &bdquo;Roki&scaron;kio sūris&ldquo; - pirmoji įmonė Lietuvoje sertifikavusi Maisto saugos sistemą, pirmoji i&scaron; pieno perdirbimo įmonių - Kokybės vadybos ir Aplinkosaugos vadybos sistemas. Grupės ilgalaikiai tikslai &ndash; sukurti subalansuotą ir užtikrinti saugią ilgalaikę rinką gaminamiems produktams, užtikrinti stabilią, suderintą beatliekinę gamybos programą, bei i&scaron;laikyti pastovius ry&scaron;ius su pieno gamintojais.&nbsp;', 'Adresas: Pramonės g.3, LT-42150 Roki&scaron;kis, Lietuva Telefonas: (8 458) 55200 Faksas: (8 458) 55300 Elektroninis pa&scaron;tas: rokiskio.suris@rokiskio.com Tinklapio adresas: www.rokiskio.com Kontaktinis asmuo: Antanas Kavaliauskas (Finansų direktorius), (8 5) 2102 717, antanas.kavaliauskas@rokiskio.com', 'lt'),
(24, 'SAB1L', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LT0000102253&externalidexchange=EX$$$$XLIT&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 0.548, 0.536, 0.5413, 0.546, 'Algirdas Butkus (Pirmininkas), Vita Urbonienė, Ilona Baranauskienė, Mindaugas Rudys, Donatas Savickas, Vytautas Sinius, Daiva &Scaron;orienėStebėtojų tarybaArvydas Salda (Pirmininkas), Gintaras Kateiva, Ramunė Vilija Zabulienė, Darius &Scaron;ulnis, Martynas Česnavičius, Miha Ko&scaron;ak, Adriano Arietti, Susan Gail Buyske', '&nbsp;', 'Adresas &ndash; Tilžės g.149, LT-76348 &Scaron;iauliai, Lietuva Telefonai: (8 41) 595 607, (8 41) 595 602 Faks. (8 41) 430 774 El. pa&scaron;tas investors@sb.ltTinklapio adresas http://www.sb.ltKontaktinis asmuo &ndash; Monika Rožytė,', 'lt'),
(25, 'SAF1R', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LV0000101129&externalidexchange=EX$$$$XRIS&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 4.74, 4.7, 4.7397, 4.74, ' Normunds Bergs (Chairman), Didzis Liepkalns, Jānis Bergs, Zane Jozepa', ' SAF Tehnika is among the world&rsquo;s top microwave carrier-class point-to-point radio manufacturers, ISO certified, with R&amp;D and complete production in Europe, offering approximately 200 products comprising solutions for mobile and fixed network operators, internet service providers, as well as state and private companies. Located in Northern Europe, SAF Tehnika managed to acquire and consolidate valuable locally available intellectual resources of the microelectronics industry and spread its presence to 100 countries, covering all relevant market segments worldwide within just a decade. The aim of the company is to deliver quality customized microwave solutions for data and voice communication at reasonable prices.', ' Address: Ganību dambis 24a, Rīga, LV-1005, Latvija Phone: + 371 67046840Internet: www.saftehnika.com E-mail: info@saftehnika.com&nbsp; Contactperson: Zane JozepaPhone: + 371 67046833E-mail: zane.jozepa@saftehnika.com ', 'en'),
(26, 'SFG1T', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=EE3100001751&externalidexchange=EX$$$$XTAL&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 1.65, 1.625, 1.6387, 1.65, 'Jarek S&auml;rgava', 'Silvano Fashion Group AS is an international lingerie distribution group involved in design, manufacturing, wholesale, franchise and retail of ladies lingerie. The Group developes six lingerie, beachwear and underwear brands: Milavitsa,&nbsp; Lauma Lingerie, Alisee, Avelin and Laumelle for ladies and Hidalgo underwear for men.Silvano Fashion Group is selling lingerie products to 23 different countries. Key sales markets are Russia, Belarus, Ukraine and Baltic states. There is alltogether 680 branded own retail and franchise stores. INSERT INTO `papildomainformacija` (`Id`, `AkcijosKodas`, `AtaskaitosURL`, `DidKaina`, `MinKaina`, `VidKaina`, `AtidarymoKaina`, `Vadyba`, `Apie`, `Kontaktai`, `Kalba`) VALUES
(45, 'RER1R', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LV0000101012&externalidexchange=EX$$$$XRIS&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 7.45, 7.45, 7.45, 7.45, ' Nikolajs Jerohovs (Mikalai Yerokhau, Chairman),&nbsp;Aleksandrs Popadins, Iļja &Scaron;estakovs, Tamāra Rogova', 'Manufacturing of carriages, other wagons, electric equipment of electric trains, electric engines, generators and transformers, manufacturing of diesel locomotives and electric trains, repairs of equipment and wagons, spare parts there of, scientific research, experimental developments, device updating, design of new kinds of railway rolling stock, steel casting, light metal casting, scrap recycling, metal&nbsp;&nbsp; forging,&nbsp;&nbsp; pressing,&nbsp;&nbsp; punching&nbsp;&nbsp; and&nbsp;&nbsp; rolling, general mechanic metal processing, design of devices, apparatus, electric equipment.', ' Address:&nbsp; Ganību dambis 53, Riga, LV-1005, Latvia Phone: + 371 67381193 Web: www.rer.lv E-mail: office@rer.lv', 'en'),
