(47, 'RKB1R', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LV0000100378&externalidexchange=EX$$$$XRIS&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 0.107, 0.105, 0.1064, 0.107, '&nbsp;Einārs Buks', 'AS &bdquo;Rīgas kuģu būvētava&rdquo; is the largest shipyard on the Eastern shores of the Baltic Sea, repairing more than 130 sea vessels per year.', '&nbsp;', 'en'),
(48, 'RRR1R', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LV0000100972&externalidexchange=EX$$$$XRIS&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 0, 0, 0, 0, 'Ēriks Ertmanis&nbsp;(Chairman), Olga Romaņko', '&ldquo;VEF Radiotehnika RRR&rdquo; PLC was founded in 1927 as &ldquo;Foto &ndash; radio centrāle A.Leibovic&rdquo; PLC, a company that specialized in radio receiver manufacturing. The company was given its present name in 1941, and between 1945 and 1990 it was the major manufacturer of audio hardware in the former USSR. Since 1990, when Latvia regained its sovereignty, the &ldquo;VEF Radiotehnika RRR&rdquo; JSC has become one of the leading home and professional Hi-Fi acoustic system manufacturers in the Eastern Europe.The successful combination of company&rsquo;s 80 - year working experience and the latest production and research technologies have made &ldquo;VEF Radiotehnika RRR&rdquo; JSC acoustic systems to be well &ndash; known for their outstanding sound quality and classical design. Up-to-date woodworking and loudspeaker production technologies and modern research laboratory enable the company to manufacture a wide range of Hi-Fi acoustic systems, including home audio hardware and speakers for home theatres, as well as professional acoustic systems used for public events.Today &ldquo;VEF Radiotehnika RRR&rdquo; is selling its products in the CIS, UAE and countries in Europe. Company specializes in: &bull;&nbsp;acoustic system production;&bull;&nbsp;production of acoustic system for home theatres;&bull;&nbsp;built-in loudspeaker production;&bull;&nbsp;manufacture of professional speaker cabinets&bull;&nbsp;manufacture of printed circuit boards;&bull;&nbsp;assembly of printed circuit boards, including SMD assembly&bull;&nbsp;assembly of electronic parts, cable harnesses', 'Adress: Kurzemes prospekts 3, Riga, Latvia, LV-1067&nbsp;Phone:+ 371 67418087 E-mail: vefrrr@latnet.lvWeb page: www.rrr.lv&nbsp;', 'en'),
(49, 'SCM1R', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LV0000100600&externalidexchange=EX$$$$XRIS&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 4.36, 4.36, 4.36, 4.36, 'Nils Ivars Feodorovs (Chairman), Valda Mālniece, Sarmīte Arcimoviča&nbsp;', '', 'Address: Kalnabeites 8, Siguldas pag., Siguldas novads,&nbsp;LV 2150, Latvia Phone: + 371 67972040 |Web: www.sigmas.lv E-mail: sigcmas@sigmas.lv Contactperson: Valda MālniecePhone:&nbsp;+371 67972040 ', 'en'),
(50, 'SKN1T', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=EE3100092503&externalidexchange=EX$$$$XTAL&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 0.496, 0.46, 0.4754, 0.484, 'Torfinn Losvik (Chairman)', 'Nordic Fibreboard AS is the largest producer of fibreboard in Estonia, with more than half a century experience in producing fibreboards using virgin woodchip from the Estonian forests as main input raw material.Nordic Fibreboard AS shares are listed on the Secondary List of Nasdaq Tallinn Stock Exchange.The main structural units of Nordic Fibreboard AS include subsidiaries Nordic Fibreboard Ltd (sale and production of fibreboards) and P&auml;rnu Riverside Development OU (real estate development).', 'Address: Suur-J&otilde;e 48, 80042 P&auml;rnu, EstoniaTelephone: +372 44 78 323E&ndash;mail:&nbsp;group@nordicfibreboard.com&nbsp; Internet webpage: www.nordicfibreboard.com&nbsp; Contact person:&nbsp;Torfinn Losvik', 'en'),
