(52, 'SNG1L', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LT0000109274&externalidexchange=EX$$$$XLIT&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 0.226, 0.218, 0.2217, 0.224, 'Pavadinimas: AB &ldquo;Snaigė&rdquo; Veiklos apra&scaron;ymas: Buitinių &scaron;aldytuvų ir &scaron;aldiklių bei jų atsarginių dalių gamyba Įmonės registracijos data: 1992 m. gruodžio 1 d. Auditorius: Grant Thornton Baltic UABAkcijų įtraukimo į Papildomąjį prekybos sąra&scaron;ą data: 1995 m. liepos 11 d. Akcijų įtraukimo į Oficialųjį prekybos sąra&scaron;ą data: 1998 m. balandžio 14 d.Akcijų įtraukimo į Papildomąjį prekybos sąra&scaron;ą data:&nbsp;2009 m.&nbsp;birželio 1 d.Rinka: Nasdaq&nbsp;VilniusAleksey Kovalchuk (Pirmininkas),&nbsp;Oleg Tsarkov,&nbsp;Anna Korneeva, Konstantin Kovalchuk, Igor ZentsovTrumpai apie bendrovę&nbsp; AB &bdquo;Snaigė&ldquo; &ndash; vienintelė buitinių &scaron;aldytuvų gamintoja Baltijos &scaron;alyse. Joje dirba 670 žmonių. Bendrovė sukaupė patirtį per daugiau nei penkiasde&scaron;imt veiklos metų. AB &bdquo;Snaigė&ldquo; gamina plataus asortimento auk&scaron;tos kokybės &scaron;aldytuvus, &scaron;aldiklius bei jų atsargines dalis. Snaigės privalumas ir stiprioji pusė &ndash; jos nuolatinė pažangių', '&nbsp; AB &bdquo;Snaigė&ldquo; &ndash; vienintelė buitinių &scaron;aldytuvų gamintoja Baltijos &scaron;alyse. Joje dirba 670 žmonių. Bendrovė sukaupė patirtį per daugiau nei penkiasde&scaron;imt veiklos metų. AB &bdquo;Snaigė&ldquo; gamina plataus asortimento auk&scaron;tos kokybės &scaron;aldytuvus, &scaron;aldiklius bei jų atsargines dalis. Snaigės privalumas ir stiprioji pusė &ndash; jos nuolatinė pažangių technologijų, apjungiančių funkcionalumą ir novatori&scaron;ką dizainą už prieinamą kainą, paie&scaron;ka. Bendrovė dirba pagal tarptautinius standartus ISO 9001, ISO 14001, BS OHSAS 18001. Snaigės funkcionalūs, ilgalaikiai ir ekologi&scaron;ki produktai eksportuojami į daugiau nei 30 Europos ir Azijos &scaron;alių.', 'Adresas: Pramonės g.6, LT-62175 Alytus, Lietuva Telefonas: (8 315) 56206 Faksas: (8 315) 56207, (8 315) 56269 Elektroninis pa&scaron;tas: snaige@snaige.lt Tinklapio adresas: www.snaige.lt Kontaktinis asmuo: Rūta Petrauskaitė (Rinkodaros direktorė), +370 5 2361970, ruta.petrauskaite@snaige.lt', 'lt'),
(53, 'TPD1T', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=EE3100003443&externalidexchange=EX$$$$XTAL&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 0.555, 0.555, 0.555, 0.555, 'Rando Tomingas', ' AS Trigon Property Development has evolved as a result of division of AS Viisnurk on 19.09.2007. The core business activity of AS Trigon Property Development since 19.09.2007 is property development in Central and Eastern European countries. Currently AS Trigon Property Development owns one property development project, which is a 22,39ha land-area in P&auml;rnu city, Estonia. The company&rsquo;s intention is to develop business property for logistics, warehousing and light industry on the area. AS Trigon Property Development intends to significantly expand its property investments portfolio in Central and Eastern European region and the company currently conducts active negotiations for acquiring new projects. Additional information on new projects will be published in due course through respective stock exchange releases. Contact details', ' Address:&nbsp;P&auml;rnu mnt 18,&nbsp;Tallinn 10141, Estonia Phone: +372 6679 200, Fax: +372 6679 201 E-mail: info@trigonproperty.com&nbsp;&nbsp; Web page: www.trigonproperty.com Contact person: ', 'en'),
(54, 'UTR1L', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LT0000109324&externalidexchange=EX$$$$XLIT&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 0, 0, 0, 0.95, 'Arūnas Martinkevičius, Dovilė Tamo&scaron;evičienė, Vytautas Va&scaron;kys,&nbsp;Giedrius Grondskis', ' AB \"Utenos trikotažas\" &ndash; nuo 1967 m. veikianti&nbsp;didžiausia ir moderniausia trikotažo produkcijos&nbsp;gamybos&nbsp;įmonė Centrinėje ir Rytų Europoje. Bendrovės, turinčios&nbsp;tris dukterines įmones AB \"&Scaron;atrija\", UAB \"Gotija\" ir dukterinę bendrovę Ukrainoje OAO \"Mrija\", eksportas sudaro apie 80 proc. pardavimų, o jo geografija driekiasi&nbsp;į&nbsp;daugiau kaip 15 &scaron;alių.&nbsp;AB \"Utenos trikotažo\" gamybiniai pajėgumai apima pilno ciklo gamybą nuo mezgimo iki pat galutinio produkto, pateikiamo vartotojui. Be medžiagų ir drabužių gamybos eksportui, UT valdo \"Utenos\" ir \"About\" mažmeninės prekybos prekių ženklus.Bendrovė nuolat siekia gerinti gaminamos produkcijos kokybę ir atsakingą požiūrį į aplinką. Nuo 2012 metų AB \"Utenos trikotažas\" vadovaujasi verslo strategija Organically Innovative. Bendrovė turi tarptautinius sertifikatus Oeko-Tex 100, OCS, GOTS, Woolmark, SA8000. AB \"Utenos trikotažas\" tapo pirmąja Lietuvos bendrove prisijungusia prie \"Greenpeace\" projekto už &scaron;varią madą - \"Detox\".AB \"Utenos trikotažas\" yra SBA koncernui priklausančios įmonių grupės dalis.&nbsp;', 'Adresas: J.Basanavičiaus g.122, LT-28214 Utena, Lietuva Telefonas: (8 389) 63080 Faksas: (8 389) 69358 Elektroninis pa&scaron;tas: utenos.trikotazas@ut.ltTinklapio adresas: www.ut.ltKontaktinis asmuo investuotojams: Živilė Jonaitytė (Finansų direktorė), zivile.jonaityte@ut.lt', 'lt'),
(55, 'VBL1L', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LT0000104267&externalidexchange=EX$$$$XLIT&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 10.4, 10.2, 10.3062, 10.3, 'Pavadinimas: AB &ldquo;Vilniaus baldai&rdquo; Veiklos apra&scaron;ymas: Masinė korpusinių baldų gamyba Įmonės registracijos data: 1993 m. vasario 9 d. Auditorius:&nbsp;\"KPMG Baltics\", UABAkcijų įtraukimo į&nbsp;Papildomąjį prekybos sąra&scaron;ą data: 2000 m.&nbsp;birželio&nbsp;5 d. Akcijų įtraukimo į Oficialųjį prekybos sąra&scaron;ą data: 2003 m. rugsėjo 1 d.Akcijų įtraukimo į Papildomąjį prekybos sąra&scaron;ą data: 2015 m. liepos 20 d.Rinka: Nasdaq&nbsp;VilniusVytautas Bučas (Pirmininkas), Dalius Kaziūnas, Vaidas SavukynasTrumpai apie bendrovę 1883 metais savo veiklą pradėjusi kaip maža dirbtuvėlė, AB &bdquo;Vilniaus baldai&ldquo; tapo viena stambiausių pramonės įmonių Lietuvoje ir Baltijos &scaron;alyse, kuri sėkmingai suderina ilgametes baldų gamybos tradicijas bei novatori&scaron;kas verslo idėjas. Iki 2004 metų ji buvo žinoma kaip AB &bdquo;Vilniaus baldų kombinatas&ldquo;.Bendrovė projektuoja, gamina ir prekiauja biuro, miegamojo, svetainės bei prie&scaron;kambario baldais. Produkcija gaminama i&scaron; drožlių plok&scaron;tės, naudojama moderniausia ir populiariausia Vakarų &scaron;alyse korinio užpildo technologija. Įmonėje sumontuota moderni įranga, įsigyta i&scaron; visame pasaulyje žinomų gamintojų, tokių kaip Holzma, Homag, Burkle, Weeke, Wikoma, Biesse ir kt. AB &ldquo;Vilniaus baldai&rdquo; eksportuoja beveik visą pagamintą produkciją į Europos ir kitas pasaulio &scaron;alis. Įmonėje sėkmingai dirbama pagal sertifikuotas kokybės vadybos (ISO 9001) ir aplinkos apsaugos vadybos (ISO 14001) sistemas. Įmonei suteiktas FSC gamybos grandies sertifikatas. Įmonėje dirba vir&scaron; 400 darbuotojų. Bendrovė strategi&scaron;kai investuoja į gamybos ', ' 1883 metais savo veiklą pradėjusi kaip maža dirbtuvėlė, AB &bdquo;Vilniaus baldai&ldquo; tapo viena stambiausių pramonės įmonių Lietuvoje ir Baltijos &scaron;alyse, kuri sėkmingai suderina ilgametes baldų gamybos tradicijas bei novatori&scaron;kas verslo idėjas. Iki 2004 metų ji buvo žinoma kaip AB &bdquo;Vilniaus baldų kombinatas&ldquo;.Bendrovė projektuoja, gamina ir prekiauja biuro, miegamojo, svetainės bei prie&scaron;kambario baldais. Produkcija gaminama i&scaron; drožlių plok&scaron;tės, naudojama moderniausia ir populiariausia Vakarų &scaron;alyse korinio užpildo technologija. Įmonėje sumontuota moderni įranga, įsigyta i&scaron; visame pasaulyje žinomų gamintojų, tokių kaip Holzma, Homag, Burkle, Weeke, Wikoma, Biesse ir kt. AB &ldquo;Vilniaus baldai&rdquo; eksportuoja beveik visą pagamintą produkciją į Europos ir kitas pasaulio &scaron;alis. Įmonėje sėkmingai dirbama pagal sertifikuotas kokybės vadybos (ISO 9001) ir aplinkos apsaugos vadybos (ISO 14001) sistemas. Įmonei suteiktas FSC gamybos grandies sertifikatas. Įmonėje dirba vir&scaron; 400 darbuotojų. Bendrovė strategi&scaron;kai investuoja į gamybos plėtrą, nuosekliai auga kurdama naujas darbo vietas, sistemingai dirba tirdama vartotojų poreikius bei ie&scaron;kodama racionalių sprendimų jiems patenkinti. Bendrovės vizija - tai modernaus žmogaus gyvenimo filosofija - amžinas, stilingas, jaukus.&nbsp;', '&nbsp;Adresas: Savanorių pr.178, LT-03154 Vilnius, Lietuva Telefonas: (8 5) 2525 700Faksas: (8 5) 2311 130 Elektroninis pa&scaron;tas: info@vilniausbaldai.ltTinklapio adresas: www.vilniausbaldai.ltKontaktinis asmuo:&nbsp;Jonas Krutinis&nbsp;(Gen. direktorius), (8 5) 2525 700', 'lt'),
(56, 'VEF1R', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LV0000101079&externalidexchange=EX$$$$XRIS&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 0, 0, 0, 4.2, ' Gints Feņuks (Chairman), Tamāra Kampāne, Mārtiņ&scaron; Cauna', 'JSC VEF has been founded in 1991. In the course of privatisation all production units according to their specialisation were spinned-off from JSC VEF and transformed in to independent companies. At the moment JSC VEF has&nbsp;17 employees. The company&nbsp;supplies electricity to the biggest part of enterprises which are operating in the territory previously owned by VEF, and also takes efforts to renovate and reconstruct owned buildings for production needs and rented offices.&nbsp;', 'Address; Brīvības gatve 214.k.1., Rīga, LV 1039, Latvija Phone: +371 67553154E-mail: kampane@vef.apollo.lv ', 'en'),
(57, 'VSS1R', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LV0000100485&externalidexchange=EX$$$$XRIS&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 1.57, 1.57, 1.57, 1.57, ' Stefan Jugel (Chairman), Ģirts Vēveris,&nbsp;Ingo Bleier', '', ' Address: Cempu iela 13, Valmiera, LV-4201, LatviaPhone: +371 64202216 Internet: www.valmiera-glass.comE-mail: latvia@valmiera-glass.comContactperson: Stefan JugelPhone: +371 64202213 E-mail:&nbsp;stefan.jugel@valmiera-glass.com', 'en'),
(58, 'ZMP1L', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LT0000121865&externalidexchange=EX$$$$XLIT&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 2, 1.94, 1.9817, 1.94, 'Robertas Pažemeckas (Pirmininkas), Marius Dromantas, Dalia Gecienė, Jurgita Petrauskienė, Jolita Gedgaudienė', '&nbsp;AB &bdquo;Žemaitijos pienas&ldquo; &ndash; viena didžiausių ir moderniausių pieno perdirbimo ir pieno produktų gamybos bendrovių Lietuvoje, savo istoriją skaičiuojanti nuo 1924 metų. Įmonėje &scaron;iuo metu dirba apie 1200 darbuotojų. Čia gaminami auk&scaron;tos kokybės gerai žinomų prekinių ženklų produktai: &bdquo;Džiugas&ldquo;, &bdquo;Magija&ldquo;, &bdquo;PIK-NIK&ldquo;, &bdquo;Žemaitijos senos tradicijos&ldquo;, &bdquo;Dobilas&ldquo; ir kt. &nbsp;Jie pasiekia Lietuvos rinką bei eksportuojami &nbsp;į ES bei NVS &scaron;alis, JAV. Bendrovė vienintelė Baltijos &scaron;alyse naudoja membraninę pieno valymo technologiją BACTOCATH, kuri užtikrina auk&scaron;čiausią produkcijos kokybę. Tai įrodo įvairiuose konkursuose bei parodose i&scaron;kovoti Lietuvos bei tarptautiniai apdovanojimai. Įmonėje gaminamų produktų saugumą bei kokybę garantuoja ir pelnytas visame pasaulyje pripažįstamas neprane&scaron;to audito sertifikatas BRC A+. &bdquo;Žemaitijos pienas&ldquo; &ndash; pirmoji bendrovė Baltijos &scaron;alyse, pelniusi &scaron;į įvertinimą. Įmonėje įdiegti ir kokybės vadybos ISO 9001 bei maisto saugos sistemos ISO 22000 standartai.', 'Adresas: Sedos g. 35, LT-87101 Tel&scaron;iai, Lietuva Tel. (8 444) 22201 Faks. (8 444) 74897 El. pa&scaron;tas: info@zpienas.lt Internetinis puslapis: http://www.zpienas.ltKontaktinis asmuo: Gintaras Keliauskas, juristas, el pa&scaron;tas: g.keliauskas@zpienas.lt', 'lt'),
(59, 'BTE1R', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LV0000101772&externalidexchange=EX$$$$XRIS&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 0.256, 0.22, 0.2381, 0.256, ' Member of Baltic Technology Ventures ASE-mail:&nbsp;Gene@baltictechventures.com', 'The company is an investment and development company, which focuses on risk and early stage venture capital investment in perspective start-up projects and technologies, specifically in the fields of technology, energy, biotech, data security, media and communications.', 'Adress: Rūpniecības iela 1-5, Riga, LV-1010Phone: +371 67783611', 'en'),
(60, 'EWA1L', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LT0000132060&externalidexchange=EX$$$$XLIT&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 6.5, 6.4, 6.45, 6.5, 'Danas &Scaron;idlauskas (pirmininkas), Gediminas Kvietkauskas, Linas Strėlis', '', 'Adresas:&nbsp;Tikslo g. 10, Kumpių k. Kauno r.&nbsp;Telefonas: +370 (37) 262318Elektroninis pa&scaron;tas:&nbsp;info@ewa.ltTinklapio adresas:&nbsp;www.ewa.ltKontaktinis asmuo: Danas &Scaron;idlauskas (Vykdomasis direktorius)', 'lt'),
(61, 'K2LT', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LT0000129009&externalidexchange=EX$$$$XLIT&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 30, 30, 30, 30, 'Vidas Andrikis,  Redas Kristanavičius, Tadas Mankevičius ir Aidas Mackevičius', '', 'Adresas:&nbsp;Metalistų g. 3, Kėdainiai,&nbsp;Lietuva Telefonas: (8 347)&nbsp;555 60 Elektroninis pa&scaron;tas: info@rekviem.ltTinklapio adresas: www.rekviem.ltKontaktinis asmuo: Bernardas Vilkelis (Direktorius)', 'lt'),
(62, 'LINDA', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=EE3100060344&externalidexchange=EX$$$$XTAL&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 0, 0, 0, 7.65, ' Kadri Rauba', 'AS Linda Nektar is an Estonian-based beverage company with origins in the 1940s. The company is providing fermented beverages for the drinks industry focusing on unpacked fruit wines under a Business-to-Business model. The company&rsquo;s production facility is located in a logistically favourable position relative to the Baltic and Northern European markets.', '&nbsp; Address: Kobela alevik, Antsla vald, 66407 V&otilde;rumaa, EstoniaTelephone: +372 785 5768E-mail: info@lindanektar.eeInternet webpage: www.lindanektar.eeContact person:', 'en'),
(63, 'MDARA', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LV0000101624&externalidexchange=EX$$$$XRIS&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 19.8, 19.4, 19.4261, 19.4, '&nbsp; Lote Tisenkopfa-Iltnere (Chairman), Uldis Iltners, Paula Tisenkopfa', ' Company MADARA Cosmetics was founded in 2006 and the MADARA brand it represents is the local pioneer in the field of natural cosmetics. Each product is exclusively developed and manufactured in MADARA Cosmetics own laboratories and production facilities, enabling to take 100% control over all processes. Organic ECOCERT certification, GMP and ISO standards, in vitro and in vivo researches emphasize MADARA Cosmetics&rsquo; passion for quality and perfection in every detail. The company exports its own brand products worldwide as well as offers contract manufacturing services. Last year, when the new, most modern production plant in Northern Europe was opened, MADARA Cosmetics made a public announcement that it would continue to work according to the principles of open business.', ' Adress: Zeltiņu iela 131, Mārupe Phone: +371 66154800Home page: www.madaracosmetics.lvE-mail: info@madaracosmetics.com', 'en'),
(64, 'NEOFI', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LT0000132953&externalidexchange=EX$$$$XLIT&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 2.72, 2.72, 2.72, 2.72, '', '&bdquo;NEO Finance&ldquo; administruoja tarpusavio skolinimo platformą &bdquo;Paskolų klubas&ldquo;, kurioje gyventojai gali skolinti vieni kitiems. Užsienio rinkose su &bdquo;NEO Finance&ldquo; prekės ženklu veikianti įmonė ES ir EEB &scaron;alių piliečiams siūlo investuoti į Lietuvos gyventojų vartojimo kreditus. &Scaron;ias veiklas įmonei vykdyti leidžia Lietuvos banko i&scaron;duota neribota elektroninių pinigų įstaigos licencija, leidžianti operacijas tarpusavio skolinimo (angl. P2P) ir varojimo kreditų rinkose visoje Europos Sąjungoje. &bdquo;NEO Finance&ldquo; prižiūri Lietuvos bankas, kas rei&scaron;kia, kad įmonė bent vieną kartą privalo atlikti i&scaron;orinį auditą, o taip pat periodi&scaron;kai pateikti reikiamas ataskaitas.', 'Adresas:&nbsp;Vivulskio g. 7,&nbsp;Vilnius, LietuvaTelefonas: 870080075Elektroninis pa&scaron;tas: info@paskoluklubas.ltTinklapio adresas: https://www.paskoluklubas.lt/, https://www.neofinance.com/Kontaktinis asmuo: Darius Borisas (Rinkodaros ir komunikacijos vadovas), darius.borisas@neofinance.lt', 'lt'),
(65, 'SAUNA', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=EE3100019753&externalidexchange=EX$$$$XTAL&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 6.9, 6.85, 6.8993, 6.9, 'Henri Lindal', 'Saunum Group AS (Saunum) is an Estonian sauna technology company founded in 2014 that is mainly concentrated on the development of electric heaters, sauna indoor air conditioners and sauna automatics. Reason for making the company and its products unique is the fact that all Saunum devises are equipped with unique patented air circulation devices that mix the sauna air in even temperatures from the floor up to the ceiling. This mechanical solution ensures an even and healthy sauna climate throughout the steam room. The sauna and all the assembly plants of the sauna partners are located in Estonia (Tallinn and Harju County).', '&nbsp;Address: P&auml;rnu mnt 478b, Tallinn 10913, Harjumaa, EestiTelephone: +372 5197 5074E-mail: info@saunum.comInternet webpage: https://saunum.com/Contact person: ', 'en'),
(66, 'GRD1R', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LV0000100659&externalidexchange=EX$$$$XRIS&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 13.85, 13.65, 13.7349, 13.85, '&nbsp;Juris Hmeļņickis (Chairman), Jānis Romanovskis&nbsp;', '', ' Address: 53 Krustpils str, Riga, LV-1057 Phone: + 371 67083500Internet: www.grindeks.lv &nbsp;E-mail: grindeks@grindeks.lv &nbsp;', 'en'),
