(69, 'FRGTE', '//lt.morningstar.com/gj8uge2g9k/stockprofile/default.aspx?externalid=LV0000101665&externalidexchange=EX$$$$XRIS&externalidtype=ISIN&LanguageId=en-GB&CurrencyId=EUR', 0, 0, 0, 0, '', ' Frigate&rsquo;s business concept is based on providing services in various investing areas according to client&rsquo;s needs. Frigate through its subsidiaries provides a wide range of services which give investors access to securities - investment advice, portfolio management, executing orders for clients, structured products for different kinds of clients, trading in financial instruments and helping companies raise funds on capital markets, but Company&rsquo;s specialization is institutional clients who would like to participate on a very fast growing market. Each of the Frigate Group companies is specializing in the provision of specific services - asset management, execution, securitization and operational support.&nbsp;', ' Adress: 18 Smil&scaron;u Street, Riga, Phone: +371 67969823 Home page: www.frigate.eu E-mail: main@frigate.eu', 'en');
